BTTTriggerConfig.BTTTouchBarAppleScriptString:
return checkStatus()on checkStatus()	--GET STORED NAME	tell application "BetterTouchTool"		--attempt to get variable		try			set LclAirPodsName to get_string_variable "AirPodsWg_DevceName"		end try	end tell	--END GET STORED NAME		--set myString to button returned of (display dialog "Connected?" buttons {"Yes", "No"})	--set myString to "name: DR-BT101 Connected: " & myString		(*uncomment line below when done testing*)	set myString to do shell script "system_profiler SPBluetoothDataType"		--initial check if it's not even there	if myString does not contain LclAirPodsName then		return " "	else				--find out if connected/disconnected		set AppleScript's text item delimiters to "name:"		set myList to the text items of myString --each item of mylist is now one of the devices				set numberOfDevices to count of myList		set counter to 1		repeat numberOfDevices times --loop through each devices checking for Connected string			if item counter of myList contains LclAirPodsName then				if item counter of myList contains "Connected: Yes" then					return checkBattery()				else if item counter of myList contains "Connected: No" then					return " "				else					display dialog "Error Parsing" --this shouldn't happen				end if			end if			set counter to counter + 1		end repeat	end ifend checkStatuson checkBattery()	set OUTPUT1 to do shell script "
OUTPUT1='';
BLUETOOTH_DEFAULTS=$(defaults read /Library/Preferences/com.apple.Bluetooth);
SYSTEM_PROFILER=$(system_profiler SPBluetoothDataType); 
MAC_ADDR=$(grep -b2 \"Minor Type: Headphones\"<<<\"${SYSTEM_PROFILER}\"|awk '/Address/{print $3}'); 
CONNECTED=$(grep -ia6 \"${MAC_ADDR}\"<<<\"${SYSTEM_PROFILER}\"|awk '/Connected: Yes/{print 1}'); 
BLUETOOTH_DATA=$(grep -ia6 '\"'\"${MAC_ADDR}\"'\"'<<<\"${BLUETOOTH_DEFAULTS}\"); 
BATTERY_LEVELS=(\"BatteryPercentCombined\" \"HeadsetBattery\" \"BatteryPercentSingle\" \"BatteryPercentRight\"); 

if [[ \"${CONNECTED}\" ]];
 then 
 for I in \"${BATTERY_LEVELS[@]}\";
  do 
  declare -x \"${I}\"=\"$(awk -v pat=\"${I}\" '$0~pat{gsub (\";\",\"\"); print $3}'<<<\"${BLUETOOTH_DATA}\")\";
   [[ ! -z \"${!I}\" ]] && 
   OUTPUT1=\"${OUTPUT}$(awk '/BatteryPercent/{print substr($0)}'<<<\"${I}\")${!I}%\";
    done;
    printf \"%s\" \"${OUTPUT1}\";
fi"		set OUTPUT2 to do shell script "
